import React from 'react';
import DataAdvice from "./DataAdvice"
import DataAdvice2 from "./DataAdvice2"
const Advice = () => {
    return (
        <>  <div className="advice_container container-fluid">
                <div className="advice_box col-md-4 col-10">
                    { DataAdvice.map((crnVal) => {
                            return (
                                <><a href="">
                                        <div className="img_data">
                                            <div class="article-overlay">{crnVal.article}
                                            </div>
                                            <img src={crnVal.img} alt="" />
                                        </div></a> </>
                            )
                        })
                    }
                </div>
            </div>
            <div className="advice_info">
            { DataAdvice2.map((crnVals) => {
                            return (
                                <>
                    <div className="main_info">
                        <div className="info_data">
                            <a href="">
                                <h2>{crnVals.h2}</h2>
                                <p>{crnVals.p}</p> </a>
                        </div>
                    </div>
                    </>
                            )
                        })
                    }
            </div>


        </>
    )
}

export default Advice;
